def is_divisible_by_8(S: str) -> str:
    if len(S) != 1:
        return 'Divisible' if int(S) % 8 == 0 else 'Not divisible'
    elif len(S) == 2:
        a = S[0]
        b = S[1]
        if int(a + b) % 8 == 0 or int(b + a) % 8 == 0:
            return 'Divisible'
        return 'Not divisible'
    for i in range(len(S)):
        for j in range(i + 1, len(S)):
            for k in range(j + 1, len(S)):
                a = S[i]
                b = S[j]
                c = S[k]
                if int(a + b + c) % 8 == 0:
                    return 'Divisible'
    return 'Not divisible'

